import { Component, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { HttpClient, HttpClientModule } from '@angular/common/http';
import { Observable } from 'rxjs';
import jsPDF from 'jspdf';
import JsBarcode from 'jsbarcode';

// Placeholder for the logo base64 (replace with actual base64 string of your logo.png)
const logoBase64 = 'data:image/png;base64,'; // Example base64 (1x1 pixel image)

interface Customer {
  id?: number;
  name: string;
  address?: string;
  email: string;
  phoneNumber?: string;
}

interface Service {
  id?: number;
  name: string;
  description?: string;
  price: number;
}

interface InvoiceService {
  service: Service;
  quantity: number;
}

interface InvoiceQuotation {
  id?: number;
  customer: Customer;
  invoiceServices: InvoiceService[];
  totalAmount: number;
  type: 'INVOICE' | 'QUOTATION';
  status: 'EN_COURS' | 'ACCEPTE' | 'REFUSE';
  createdAt?: string;
}

@Component({
  selector: 'app-invoices-quotations',
  standalone: true,
  imports: [CommonModule, FormsModule, HttpClientModule],
  template: `
    <div class="min-h-screen bg-gradient-to-br from-[#245C67] to-[#568086] text-[#568086]">
      <!-- Header -->
      <header class="bg-[#0A4955] text-white py-8 shadow-xl">
        <div class="container mx-auto px-6">
          <h1 class="text-4xl font-bold tracking-tight">Invoices & Quotations</h1>
          <p class="mt-2 text-[#EA7988] text-lg">Create and manage your documents</p>
        </div>
      </header>

      <!-- Main Content -->
      <main class="container mx-auto px-6 py-10 max-w-6xl">
        <!-- Add Form -->
        <section class="mb-12">
          <div class="bg-white rounded-xl shadow-lg p-8 transition-all hover:shadow-2xl">
            <h2 class="text-2xl font-semibold text-[#0A4955] mb-6">Create Invoice/Quotation</h2>
            <form (submit)="saveInvoiceQuotation()" class="grid grid-cols-1 md:grid-cols-2 gap-6">
              <select 
                [(ngModel)]="newInvoiceQuotation.type" 
                name="type" 
                required 
                class="w-full p-3 border border-[#568086] rounded-lg focus:outline-none focus:ring-2 focus:ring-[#0A4955] transition-all">
                <option value="QUOTATION">Devis (Quotation)</option>
                <option value="INVOICE">Facture (Invoice)</option>
              </select>
              <select 
                [(ngModel)]="newInvoiceQuotation.customer" 
                name="customer" 
                required 
                class="w-full p-3 border border-[#568086] rounded-lg focus:outline-none focus:ring-2 focus:ring-[#0A4955] transition-all">
                <option [ngValue]="null" disabled>Select a Customer</option>
                <option *ngFor="let customer of customers" [ngValue]="customer">{{ customer.name }}</option>
              </select>
              <div class="col-span-full space-y-4">
                <div *ngFor="let serviceItem of newInvoiceQuotation.invoiceServices; let i = index" class="flex space-x-4 items-center">
                  <select 
                    [(ngModel)]="serviceItem.service" 
                    [name]="'service' + i" 
                    required 
                    class="flex-1 p-3 border border-[#568086] rounded-lg focus:outline-none focus:ring-2 focus:ring-[#0A4955] transition-all">
                    <option [ngValue]="null" disabled>Select a Service</option>
                    <option *ngFor="let service of services" [ngValue]="service">{{ service.name }}</option>
                  </select>
                  <input 
                    [(ngModel)]="serviceItem.quantity" 
                    [name]="'quantity' + i" 
                    type="number" 
                    min="1" 
                    required 
                    placeholder="Qty" 
                    class="w-24 p-3 border border-[#568086] rounded-lg focus:outline-none focus:ring-2 focus:ring-[#0A4955] transition-all">
                  <button 
                    type="button" 
                    (click)="removeService(i)" 
                    class="bg-[#DB1E37] text-white px-4 py-2 rounded-lg hover:bg-[#E44D62] transition-colors duration-300">
                    Remove
                  </button>
                </div>
              </div>
              <div class="col-span-full flex space-x-4">
                <button 
                  type="button" 
                  (click)="addService()" 
                  class="bg-[#568086] text-white px-6 py-3 rounded-lg hover:bg-[#245C67] transition-colors duration-300">
                  Add Service
                </button>
                <button 
                  type="submit" 
                  class="bg-[#0A4955] text-white px-6 py-3 rounded-lg hover:bg-[#245C67] transition-colors duration-300">
                  Create
                </button>
              </div>
            </form>
          </div>
        </section>

        <!-- Invoice/Quotation List -->
        <section>
          <div class="bg-white rounded-xl shadow-lg p-8">
            <h2 class="text-2xl font-semibold text-[#0A4955] mb-6">Invoice/Quotation List</h2>
            <div class="overflow-x-auto">
              <table class="w-full border-collapse">
                <thead>
                  <tr class="bg-[#245C67] text-white">
                    <th class="p-4 text-left rounded-tl-lg">Details</th>
                    <th class="p-4 text-left rounded-tr-lg">Actions</th>
                  </tr>
                </thead>
                <tbody>
                  <tr *ngFor="let iq of invoicesQuotations" class="border-b border-[#568086] hover:bg-[#EA7988] hover:bg-opacity-10 transition-colors duration-200 relative">
                    <td class="p-4">
                      {{ iq.type === 'QUOTATION' ? 'Devis' : 'Facture' }} {{ iq.id | number: '2.0-2' }} - {{ iq.customer.name }} - 
                      <span 
                        (click)="toggleDropdown(iq.id)" 
                        class="cursor-pointer text-[#0A4955] hover:underline">
                        {{ iq.status === 'EN_COURS' ? 'En cours' : iq.status === 'ACCEPTE' ? 'Accept' : 'Refus' }}
                      </span>
                      <!-- Dropdown -->
                      <div 
                        *ngIf="showDropdown === iq.id && iq.status === 'EN_COURS'" 
                        class="absolute bg-white border border-[#568086] rounded-md shadow-md mt-1 z-10">
                        <button 
                          (click)="acceptInvoiceQuotation(iq)" 
                          class="block w-full text-left px-4 py-2 hover:bg-[#245C67] hover:text-white transition-colors">Accepter</button>
                        <button 
                          (click)="rejectInvoiceQuotation(iq)" 
                          class="block w-full text-left px-4 py-2 hover:bg-[#245C67] hover:text-white transition-colors">Refuser</button>
                      </div>
                    </td>
                    <td class="p-4 flex space-x-2">
                      <button 
                        (click)="downloadPDF(iq)" 
                        class="bg-[#0A4955] text-white px-4 py-2 rounded-lg hover:bg-[#245C67] transition-colors duration-300">
                        Download PDF
                      </button>
                      <button 
                        (click)="deleteInvoiceQuotation(iq.id!)" 
                        class="bg-[#DB1E37] text-white px-4 py-2 rounded-lg hover:bg-[#E44D62] transition-colors duration-300">
                        Delete
                      </button>
                    </td>
                  </tr>
                </tbody>
              </table>
            </div>
          </div>
        </section>

        <!-- Popup -->
        <div 
          *ngIf="showPopup" 
          class="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-20">
          <div class="bg-white p-6 rounded-xl shadow-lg">
            <p class="text-[#0A4955] text-lg">Do you want to turn this into an invoice?</p>
            <div class="mt-4 flex justify-end space-x-2">
              <button 
                (click)="confirmToInvoice()" 
                class="bg-[#0A4955] text-white px-6 py-2 rounded-lg hover:bg-[#245C67] transition-colors duration-300">
                Yes
              </button>
              <button 
                (click)="closePopup()" 
                class="bg-[#568086] text-white px-6 py-2 rounded-lg hover:bg-[#245C67] transition-colors duration-300">
                No
              </button>
            </div>
          </div>
        </div>
      </main>
    </div>
  `,
  styles: []
})
export class InvoicesQuotationsComponent implements OnInit {
  private customersApiUrl = 'http://localhost:8085/api/customers';
  private servicesApiUrl = 'http://localhost:8085/api/customerservices';
  private invoicesApiUrl = 'http://localhost:8085/api/invoices-quotations';

  constructor(private http: HttpClient) {}

  getCustomers(): Observable<Customer[]> {
    return this.http.get<Customer[]>(this.customersApiUrl);
  }

  getServices(): Observable<Service[]> {
    return this.http.get<Service[]>(this.servicesApiUrl);
  }

  getInvoicesQuotations(): Observable<InvoiceQuotation[]> {
    return this.http.get<InvoiceQuotation[]>(this.invoicesApiUrl);
  }

  createInvoiceQuotation(invoiceQuotation: InvoiceQuotation): Observable<InvoiceQuotation> {
    const payload = {
      ...invoiceQuotation,
      invoiceServices: invoiceQuotation.invoiceServices.map(item => ({
        service: { id: item.service.id },
        quantity: item.quantity
      })),
      status: 'EN_COURS'
    };
    return this.http.post<InvoiceQuotation>(this.invoicesApiUrl, payload);
  }

  updateInvoiceQuotation(invoiceQuotation: InvoiceQuotation): Observable<InvoiceQuotation> {
    return this.http.put<InvoiceQuotation>(`${this.invoicesApiUrl}/${invoiceQuotation.id}`, invoiceQuotation);
  }

  deleteInvoiceQuotation(id: number) {
    this.http.delete<void>(`${this.invoicesApiUrl}/${id}`).subscribe(() => this.loadData());
  }

  customers: Customer[] = [];
  services: Service[] = [];
  invoicesQuotations: InvoiceQuotation[] = [];
  newInvoiceQuotation: InvoiceQuotation = { 
    customer: null!, 
    invoiceServices: [], 
    totalAmount: 0, 
    type: 'QUOTATION',
    status: 'EN_COURS'
  };

  showDropdown: number | null = null;
  showPopup: boolean = false;
  selectedInvoiceQuotation: InvoiceQuotation | null = null;

  public ngOnInit(): void {
    this.loadData();
  }

  loadData() {
    this.getCustomers().subscribe(data => this.customers = data);
    this.getServices().subscribe(data => this.services = data);
    this.getInvoicesQuotations().subscribe(data => this.invoicesQuotations = data);
  }

  addService() {
    this.newInvoiceQuotation.invoiceServices.push({ service: null!, quantity: 1 });
  }

  removeService(index: number) {
    this.newInvoiceQuotation.invoiceServices.splice(index, 1);
  }

  saveInvoiceQuotation() {
    if (!this.newInvoiceQuotation.customer || this.newInvoiceQuotation.invoiceServices.length === 0 || 
        this.newInvoiceQuotation.invoiceServices.some(item => !item.service || !item.service.id)) {
      alert('Please select a customer and at least one valid service with a quantity.');
      return;
    }
    this.createInvoiceQuotation(this.newInvoiceQuotation).subscribe({
      next: () => {
        this.loadData();
        this.newInvoiceQuotation = { 
          customer: null!, 
          invoiceServices: [], 
          totalAmount: 0, 
          type: 'QUOTATION', 
          status: 'EN_COURS' 
        };
      },
      error: (err) => console.error('Error saving invoice/quotation:', err)
    });
  }

  toggleDropdown(id: number | undefined) {
    this.showDropdown = this.showDropdown === id ? null : id!;
  }

  acceptInvoiceQuotation(iq: InvoiceQuotation) {
    this.selectedInvoiceQuotation = iq;
    this.showDropdown = null;
    if (iq.type === 'QUOTATION') {
      this.showPopup = true;
    } else {
      iq.status = 'ACCEPTE';
      this.updateInvoiceQuotation(iq).subscribe(() => this.loadData());
    }
  }

  rejectInvoiceQuotation(iq: InvoiceQuotation) {
    iq.status = 'REFUSE';
    this.showDropdown = null;
    this.updateInvoiceQuotation(iq).subscribe(() => this.loadData());
  }

  confirmToInvoice() {
    if (this.selectedInvoiceQuotation) {
      this.selectedInvoiceQuotation.type = 'INVOICE';
      this.selectedInvoiceQuotation.status = 'ACCEPTE';
      this.updateInvoiceQuotation(this.selectedInvoiceQuotation).subscribe(() => {
        this.loadData();
        this.closePopup();
      });
    }
  }

  closePopup() {
    this.showPopup = false;
    this.selectedInvoiceQuotation = null;
  }

  // Helper function to convert numbers to French words (up to 999,999)
  numberToFrenchWords(num: number): string {
    const units = [
      '', 'un', 'deux', 'trois', 'quatre', 'cinq', 'six', 'sept', 'huit', 'neuf',
      'dix', 'onze', 'douze', 'treize', 'quatorze', 'quinze', 'seize', 'dix-sept', 'dix-huit', 'dix-neuf'
    ];
    const tens = ['', '', 'vingt', 'trente', 'quarante', 'cinquante', 'soixante', 'soixante-dix', 'quatre-vingt', 'quatre-vingt-dix'];
    const thousands = ['', 'mille'];

    // Handle zero
    if (num === 0) return 'zro';

    // Handle negative numbers (though not needed for this case)
    if (num < 0) return `moins ${this.numberToFrenchWords(Math.abs(num))}`;

    let words = '';

    // Handle thousands
    const thousandPart = Math.floor(num / 1000);
    const remainder = num % 1000;

    if (thousandPart > 0) {
      if (thousandPart === 1) {
        words += 'mille';
      } else {
        words += `${this.numberToFrenchWords(thousandPart)} mille`;
      }
    }

    // Handle remainder (hundreds, tens, units)
    if (remainder > 0) {
      if (words) words += ' ';

      const hundredPart = Math.floor(remainder / 100);
      const tensUnits = remainder % 100;

      // Handle hundreds
      if (hundredPart > 0) {
        if (hundredPart === 1) {
          words += 'cent';
        } else {
          words += `${units[hundredPart]} cent`;
        }
        if (tensUnits > 0) words += ' ';
      }

      // Handle tens and units
      if (tensUnits > 0) {
        if (tensUnits < 20) {
          words += units[tensUnits];
        } else {
          const tensPart = Math.floor(tensUnits / 10);
          const unitPart = tensUnits % 10;

          if (tensPart === 7 || tensPart === 9) {
            // Special case for 70s and 90s (e.g., 71 = soixante et onze, 91 = quatre-vingt-onze)
            words += `${tens[tensPart - 1]} ${unitPart === 1 ? 'et ' : ''}${units[10 + unitPart]}`;
          } else {
            words += `${tens[tensPart]}${unitPart === 1 && tensPart !== 8 ? ' et ' : unitPart > 0 ? '-' : ''}${unitPart > 0 ? units[unitPart] : ''}`;
            // Special case for 80 (quatre-vingts if no unit, quatre-vingt if followed by a unit)
            if (tensPart === 8 && unitPart === 0) words += 's';
          }
        }
      }
    }

    return words.trim();
  }

  // Helper function to sanitize the invoice number for barcode generation
  sanitizeForBarcode(text: string): string {
    // Replace "N" with "No", remove spaces, and keep alphanumeric characters and hyphens
    return text.replace(/N/g, 'No').replace(/\s+/g, '');
  }

  // Helper function to generate barcode as base64 image
  generateBarcodeBase64(text: string): string {
    const canvas = document.createElement('canvas');
    JsBarcode(canvas, text, {
      format: 'CODE128',
      displayValue: false,
      width: 2,
      height: 20,
      margin: 0
    });
    return canvas.toDataURL('image/png');
  }

  downloadPDF(iq: InvoiceQuotation) {
    const doc = new jsPDF();
    const pageWidth = doc.internal.pageSize.getWidth();
    const pageHeight = doc.internal.pageSize.getHeight();
    const margin = 15;
    let y = margin;
  
    // Set default font to Helvetica to match the invoice style
    doc.setFont('helvetica', 'normal');
  
    // Add Logo (replacing REDSTART text)
    doc.addImage(logoBase64, 'PNG', margin, y - 5, 50, 40); // Adjust size (30x30) as needed
    y += 25; // Move down after logo
    doc.setFontSize(12);
    doc.setTextColor('#000000');
    doc.setFontSize(18);
    doc.text(iq.type === 'QUOTATION' ? 'DEVIS' : 'FACTURE', pageWidth - margin - doc.getTextWidth(iq.type === 'QUOTATION' ? 'DEVIS' : 'FACTURE'), y - 5, { align: 'right' });
    y += 5;
  
    // Invoice Number (moved below "DEVIS"/"FACTURE" and above barcode)
    doc.setFontSize(12);
    doc.setFont('helvetica', 'normal');
    const invoiceNumber = `N ${iq.type === 'QUOTATION' ? 'DEV' : 'FAC'}-2025-${String(iq.id).padStart(6, '0')}`;
    doc.text(invoiceNumber, pageWidth - margin - doc.getTextWidth(invoiceNumber), y, { align: 'right' });
    y += 10; // Add space between invoice number and barcode
  
    // Barcode (with increased margin below and adjusted width)
    const barcodeText = this.sanitizeForBarcode(invoiceNumber); // e.g., "NoDEV-2025-000010"
    const barcodeBase64 = this.generateBarcodeBase64(barcodeText);
    doc.addImage(barcodeBase64, 'PNG', pageWidth - margin - 60, y, 80, 10); // Width increased from 50 to 60
    y += 25; // Increased margin below barcode (was 15, now 25 to add more space)
  
    // Client Info (with border: top/bottom dark blue, left/right gray)
    const clientBoxY = y - 5;
    const clientBoxHeight = 40;
    doc.setLineWidth(0.5);
    // Top border (dark blue)
    doc.setDrawColor('#00008B'); // Darker blue
    doc.line(margin, clientBoxY, margin + 80, clientBoxY);
    // Bottom border (dark blue)
    doc.line(margin, clientBoxY + clientBoxHeight, margin + 80, clientBoxY + clientBoxHeight);
    // Left and right borders (gray)
    doc.setDrawColor('#D3D3D3');
    doc.line(margin, clientBoxY, margin, clientBoxY + clientBoxHeight); // Left
    doc.line(margin + 80, clientBoxY, margin + 80, clientBoxY + clientBoxHeight); // Right
  
    doc.setFontSize(12);
    doc.setFont('helvetica', 'bold');
    doc.setTextColor('#000000');
    doc.text('CLIENT', margin + 2, y);
    y += 5;
    doc.setFont('helvetica', 'normal');
    doc.setFontSize(10);
    doc.text(iq.customer.name, margin + 2, y);
    y += 5;
    doc.text(iq.customer.address || 'N/A', margin + 2, y);
    y += 5;
    doc.text('2035 Tunis Tunisie', margin + 2, y);
    y += 5;
    doc.text(`Email: ${iq.customer.email}`, margin + 2, y);
    y += 5;
    doc.text(`Mobile: ${iq.customer.phoneNumber || 'N/A'}`, margin + 2, y);
  
    // Date and Project Name (right-aligned with border, increased bottom margin)
    const dateBoxY = y - 35;
    const dateBoxHeight = 20; // Increased height for more bottom margin
    doc.setDrawColor('#00008B'); // Darker blue
    doc.rect(pageWidth - margin - 50, dateBoxY, 50, dateBoxHeight); // Rectangle around date and project
    doc.setFontSize(12);
    doc.setFont('helvetica', 'normal');
    const dateText = `Date: ${new Date().toLocaleDateString('fr-FR')}`;
    doc.text(dateText, pageWidth - margin - 48, dateBoxY + 5); // Adjusted position
    doc.setFont('helvetica', 'bold');
    doc.text('REDBOOST', pageWidth - margin - 48, dateBoxY + 12); // Adjusted position
    y += 15;
  
    // Table Headers
    const tableTopY = y - 5;
    doc.setFontSize(10);
    doc.setFont('helvetica', 'bold');
    const headers = ['#', 'Description', 'Quantit', 'Unit', 'PU HT', 'TVA', 'Total HT'];
    const colWidths = [10, 70, 20, 20, 25, 15, 30];
    let x = margin;
    headers.forEach((header, i) => {
      doc.text(header, x + 2, y); // Padding inside the cell
      x += colWidths[i];
    });
    y += 5;
  
    // Table Borders (Dark blue top, gray sides/bottom)
    const tableWidth = colWidths.reduce((sum, width) => sum + width, 0);
    doc.setDrawColor('#00008B'); // Darker blue top border
    doc.setLineWidth(0.5);
    doc.line(margin, tableTopY, margin + tableWidth, tableTopY); // Top border
  
    // Table Rows with Borders
    doc.setFont('helvetica', 'normal');
    let tableBottomY = y;
    iq.invoiceServices.forEach((item, index) => {
      x = margin;
      const totalHT = item.quantity * item.service.price;
      const tvaRate = 0.19; // 19% TVA as per the image
      const tvaAmount = totalHT * tvaRate;
  
      // Row data
      const row = [
        String(index + 1),
        item.service.name,
        String(item.quantity),
        'pcs', // Static unit as per image
        item.service.price.toFixed(3) + ' DT',
        '19 %',
        totalHT.toFixed(3) + ' DT'
      ];
  
      let rowHeight = 10; // Using let as fixed previously
      row.forEach((cell, i) => {
        doc.text(cell, x + 2, y, { maxWidth: colWidths[i] - 4 }); // Padding inside the cell
        x += colWidths[i];
      });
  
      // Add description (if any) below the service name
      if (item.service.description) {
        y += 5;
        doc.setFontSize(8);
        doc.text(item.service.description, margin + colWidths[0] + 2, y, { maxWidth: colWidths[1] - 4 });
        doc.setFontSize(10);
        rowHeight += 5;
      }
      y += 10;
      tableBottomY = y - 5;
    });
  
    // Draw table side and bottom borders (gray)
    doc.setDrawColor('#D3D3D3'); // Gray borders
    doc.setLineWidth(0.3);
    doc.line(margin, tableTopY, margin, tableBottomY); // Left border
    doc.line(margin + tableWidth, tableTopY, margin + tableWidth, tableBottomY); // Right border
    doc.line(margin, tableBottomY, margin + tableWidth, tableBottomY); // Bottom border
  
    // Vertical lines between columns
    x = margin;
    for (let i = 0; i < colWidths.length - 1; i++) {
      x += colWidths[i];
      doc.line(x, tableTopY, x, tableBottomY); // Vertical lines
    }
  
    // Totals Section (right-aligned with bordered table)
    const totalHT = iq.invoiceServices.reduce((sum, item) => sum + (item.quantity * item.service.price), 0);
    const tvaRate = 0.19; // 19% TVA
    const tvaAmount = totalHT * tvaRate;
    const timbreFiscal = 1.000; // Static as per image
    const netAPayer = totalHT + tvaAmount + timbreFiscal;
  
    const totalsTableWidth = 80;
    const totalsTableX = pageWidth - margin - totalsTableWidth;
    const totalsTableY = y + 10;
    const totals = [
      { label: 'TOTAL HT', value: totalHT.toFixed(3) + ' DT' },
      { label: 'BASE TVA', value: totalHT.toFixed(3) + ' DT' },
      { label: 'TVA 19 %', value: tvaAmount.toFixed(3) + ' DT' },
      { label: 'TOTAL TVA', value: tvaAmount.toFixed(3) + ' DT' },
      { label: 'Timbre fiscal', value: timbreFiscal.toFixed(3) + ' DT' }
    ];
  
    // Draw totals table background (light gray)
    doc.setFillColor('#F5F5F5'); // Light gray background
    doc.rect(totalsTableX, totalsTableY - 5, totalsTableWidth, totals.length * 5 + 10, 'F');
  
    // Draw totals table borders (gray)
    doc.setDrawColor('#D3D3D3');
    doc.setLineWidth(0.3);
    doc.rect(totalsTableX, totalsTableY - 5, totalsTableWidth, totals.length * 5 + 10);
  
    // Totals content
    doc.setFont('helvetica', 'normal');
    doc.setFontSize(10);
    let totalY = totalsTableY;
    totals.forEach((total) => {
      doc.text(total.label, totalsTableX + 2, totalY);
      doc.text(total.value, totalsTableX + totalsTableWidth - 2, totalY, { align: 'right' });
      totalY += 5;
    });
  
    // Net  payer (bold and larger, with border)
    doc.setDrawColor('#D3D3D3');
    doc.rect(totalsTableX, totalY, totalsTableWidth, 10);
    doc.setFillColor('#F5F5F5');
    doc.rect(totalsTableX, totalY, totalsTableWidth, 10, 'F');
    doc.setFont('helvetica', 'bold');
    doc.setFontSize(12);
    doc.text('NET  PAYER', totalsTableX + 2, totalY + 7);
    doc.text(netAPayer.toFixed(3) + ' DT', totalsTableX + totalsTableWidth - 2, totalY + 7, { align: 'right' });
  
    // Payment Terms (dynamically convert netAPayer to French words)
    doc.setFont('helvetica', 'normal');
    doc.setFontSize(10);
    y = totalY + 20;
    doc.text('Arrte la prsente facture  la somme de :', margin, y);
    y += 5;
    const netAPayerInWords = this.numberToFrenchWords(Math.floor(netAPayer)) + ' dinars';
    doc.text(netAPayerInWords, margin, y);
  
    // Footer
    y = pageHeight - 40;
    doc.setDrawColor('#00008B'); // Darker blue line for footer
    doc.setLineWidth(0.5);
    doc.line(margin, y, pageWidth - margin, y);
    y += 5;
  
    doc.setFontSize(9);
    const footerColumns = [
      {
        title: 'REDSTART TUNISIE',
        lines: [
          '3 RUE EL KAWAKIBI- BELVDRE',
          '1002 TUNIS',
          'Code TVA: 15719432/A/M/000'
        ]
      },
      {
        title: 'INFORMATIONS DE CONTACT',
        lines: [
          'REDSTART Tunisie',
          'M +21677193125',
          'hello@redstart.tn',
          'www.redstart.tn'
        ]
      },
      {
        title: 'INFORMATIONS BANCAIRES',
        lines: [
          'Banque Zitouna - Banque Zitouna',
          'SWIFT/BIC: BZITNTT',
          'IBAN: TN59 1500 0000 0066 1921 31'
        ]
      }
    ];
  
    x = margin;
    const colWidth = (pageWidth - 2 * margin) / 3;
    footerColumns.forEach((col, i) => {
      doc.setFont('helvetica', 'bold');
      doc.text(col.title, x, y);
      doc.setFont('helvetica', 'normal');
      col.lines.forEach((line, j) => {
        doc.text(line, x, y + (j + 1) * 5);
      });
      x += colWidth;
    });
  
    // Page Number
    doc.text('Page 1', pageWidth - margin - doc.getTextWidth('Page 1'), pageHeight - 10, { align: 'right' });
  
    // Save PDF
    doc.save(`${iq.type.toLowerCase()}-2025-${String(iq.id).padStart(6, '0')}.pdf`);
  }
}